INSERT INTO `his_config_info` VALUES (0, 12, 'infra-search.yaml', 'DEFAULT_GROUP', '', 'server:\n  port: 8002\n    \ndubbo:\n  cloud:\n    # 服务消费方订阅服务提供方的应用名称的列表\n    # 若需订阅多应用，使用 \",\" 分割\n    subscribed-services: infra-search\n  scan:\n    # dubbo 服务扫描基础包路径\n    base-packages: com.kimzing.search.service', 'b3ef27ebf0e2193bd721779fd9db091a', '2020-08-25 21:02:29', '2020-08-25 13:02:29', NULL, '0:0:0:0:0:0:0:1', 'I', 'dev');
INSERT INTO `his_config_info` VALUES (0, 13, 'service-product.yaml', 'DEFAULT_GROUP', '', 'server:\n  port: 8082\n    \nspring:\n  datasource:\n    # 添加&allowMultiQueries=true使得一个接口可以执行多条语句\n    url: jdbc:mysql://mysql.kimzing.com:3306/springcloud-product?setUnicode=true&characterEncoding=utf8&allowMultiQueries=true&queryInterceptors=brave.mysql8.TracingQueryInterceptor&exceptionInterceptors=brave.mysql8.TracingExceptionInterceptor&zipkinServiceName=mysql-${spring.application.name}\n    username: root\n    password: 123456\n\ndubbo:\n  cloud:\n    # 服务消费方订阅服务提供方的应用名称的列表\n    # 若需订阅多应用，使用 \",\" 分割\n    subscribed-services: \"\"\n  scan:\n    # dubbo 服务扫描基础包路径\n    base-packages: com.kimzing.product.service', 'a618e8a33979a29eb67a5a83b688b3a9', '2020-08-25 21:02:29', '2020-08-25 13:02:29', NULL, '0:0:0:0:0:0:0:1', 'I', 'dev');
INSERT INTO `his_config_info` VALUES (11, 14, 'infra-storage.yaml', 'DEFAULT_GROUP', '', 'server:\n  port: 8003\n    \nspring:\n  datasource:\n    # 添加&allowMultiQueries=true使得一个接口可以执行多条语句\n    url: jdbc:mysql://mysql.kimzing.com:3306/springcloud-storage?setUnicode=true&characterEncoding=utf8&allowMultiQueries=true&queryInterceptors=brave.mysql8.TracingQueryInterceptor&exceptionInterceptors=brave.mysql8.TracingExceptionInterceptor&zipkinServiceName=mysql-${spring.application.name}\n    username: root\n    password: 123456\n\nkimzing:\n  web:\n    result:\n      enabled: false\n  minio:\n    # 是否启用minio配置(默认false)\n    enabled: true\n    # minio服务地址\n    url: http://minio.kimzing.com:9000\n    accessKey: admin\n    secretKey: 1234567890\n    # 统一对象前缀\n    prefix: \n    # 前缀类型\n    prefixType: time\n    # 前缀时间的格式\n    timePattern: yyyyMMddHHmmss-', '518902250f783c3779f106e37a95d47b', '2020-08-25 21:21:17', '2020-08-25 13:21:17', NULL, '0:0:0:0:0:0:0:1', 'U', 'dev');
INSERT INTO `his_config_info` VALUES (8, 15, 'common.yaml', 'DEFAULT_GROUP', '', '# ===============Spring配置=================\nspring:\n  datasource:\n    driver-class-name: com.mysql.cj.jdbc.Driver\n    hikari:\n      max-lifetime: 60000\n  servlet:\n    multipart:\n      # 单个上传文件大小\n      max-file-size: 50MB\n      # 请求允许的总大小\n      max-request-size: 50MB\n  cloud:\n    # Sentinel 配置项，对应 SentinelProperties 配置属性类\n    sentinel:\n      # 是否开启。默认为 true 开启\n      enabled: true\n      # 是否饥饿加载。默认为 false 关闭\n      eager: true\n      transport:\n        # Sentinel 控制台地址\n        dashboard: sentinel.kimzing.com:8858\n      filter:\n        # 拦截请求的地址。默认为 /*\n        url-patterns: /**\n      # Sentinel 规则的数据源，是一个 Map 类型。key 为数据源名，可自定义；value 为数据源的具体配置\n      datasource:\n        ds1:\n          # 对应 DataSourcePropertiesConfiguration 类\n          nacos:\n            # Nacos 服务器地址\n            server-addr: ${nacos-server-addr:nacos.kimzing.com:8848}\n            namespace: dev\n            # Nacos 分组\n            group-id: DEFAULT_GROUP\n            # Nacos 配置集编号\n            data-id: ${spring.application.name}-rule.json\n            # 数据格式\n            data-type: json\n            # 规则类型\n            rule-type: FLOW\n  zipkin:\n    # Zipkin 服务的地址\n    base-url: http://zipkin.kimzing.com:9411\n  sleuth:\n    # 针对 Web 组件的配置项\n    web:\n      # 是否开启，默认为 true\n      enabled: true\n    # 针对 Feign 组件的配置项\n    feign:\n      # 是否开启，默认为 true\n      enabled: true\n    # 针对 Slf4j 组件的配置项\n    log:\n      slf4j:\n        # 是否开启，默认为 true\n        enabled: true\n    # 针对抽样收集的配置项，两个配置项都设置的情况下，采用 ProbabilityBasedSampler 采样器\n    sampler:\n      # 采样百分比，默认为空\n      probability: 1\n      # 限流采样，即每秒可收集链路的数量，默认为 10\n      rate: 10\n  # 设置flyway不校验丢失的文件, 因为每个服务都使用独立的数据源，所以可以关闭该选项\n  #flyway:\n    #ignore-missing-migrations: true\n# ===============Actuator管理端口=================\nmanagement:\n  endpoints:\n    web:\n      exposure:\n        include: \'*\'\n  endpoint:\n    health:\n      show-details: always\n# ===============RocketMQ公共配置==============\n# 对应 RocketMQProperties 配置类\nrocketmq:\n  # RocketMQ Namesrv\n  name-server: rocketmq.kimzing.com:9876\n  # Producer 配置项\n  producer:\n    group: ${spring.application.name}-group\n    # 发送消息超时时间，单位：毫秒。默认为 3000 。\n    send-message-timeout: 3000\n    # 消息压缩阀值，当消息体的大小超过该阀值后，进行消息压缩。默认为 4 * 1024B\n    compress-message-body-threshold: 4096\n    # 消息体的最大允许大小。。默认为 4 * 1024 * 1024B\n    max-message-size: 4194304\n    # 同步发送消息时，失败重试次数。默认为 2 次。\n    retry-times-when-send-failed: 2\n    # 异步发送消息时，失败重试次数。默认为 2 次。\n    retry-times-when-send-async-failed: 2\n    # 发送消息给 Broker 时，如果发送失败，是否重试另外一台 Broker 。默认为 false\n    retry-next-server: true\n    # 是否开启消息轨迹功能。默认为 true 开启。\n    enable-msg-trace: true\n    # 自定义消息轨迹的 Topic 。默认为 RMQ_SYS_TRACE_TOPIC 。\n    customized-trace-topic: RMQ_SYS_TRACE_TOPIC\n  # Consumer 配置项\n  consumer:\n    # 配置某个消费分组，是否监听指定 Topic 。结构为 Map<消费者分组, <Topic, Boolean>> 。默认情况下，不配置表示监听。\n    listeners:\n      test-group:\n        # 关闭 test-consumer-group 对 topic1 的监听消费\n        test: false\n# ===============分布式事物Seata公共配置==============\nseata:\n  enabled: true\n  application-id: ${spring.application.name}\n  tx-service-group: ${spring.application.name}-group\n  enable-auto-data-source-proxy: true\n  config:\n    type: nacos\n    nacos:\n      serverAddr: ${nacos-server-addr:nacos.kimzing.com:8848}\n      # 因为配置比较杂乱，统一放在seata命名空间\n      namespace: seata\n      group: SEATA_GROUP\n      username: ${nacos-username:dev}\n      password: ${nacos-password:123456}\n  registry:\n    type: nacos\n    nacos:\n      application: seata-server\n      server-addr: ${nacos-server-addr:nacos.kimzing.com:8848}\n      namespace: ${spring.profiles.active}\n      username: ${nacos-username:dev}\n      password: ${nacos-password:123456}\n# ===============Dubbo公共配置=================\ndubbo:\n  consumer:\n    # 默认超时时间\n    timeout: 3000\n    # 开启消费端参数校验\n    validation: true\n    # 关闭提供者检查\n    check: false\n    # 链路跟踪\n    filter: tracing\n  provider:\n    validation: true\n    filter: -exception,exceptionFilter,-validation,validationFilter,tracing\n    exception:\n      package: com.kimzing.\n  # 挂载到 Nacos 注册中心, nacos://nacos.kimzing.com:8848?namespace=dev&username=dev&password=123456\n  registry:\n    address: nacos://nacos.kimzing.com:8848\n  # Dubbo 服务暴露的协议配置\n  protocol:\n    id: dubbo\n    # 协议名称\n    name: dubbo\n    # 协议端口（ -1 表示自增端口，从 20880 开始）\n    port: -1\n\n# ===============knife4j公共配置=================\n# knife开源的swagger ui配置\nknife4j:\n  # 是否是生产环境，如果是生产环境会默认关闭swagger\n  production: false\n  # 配置自定义markdown文件的位置\n  markdowns: classpath:markdown/*\n  # 配置认证功能\n  basic:\n    # 是否开启认证\n    enable: true\n    # 用户名\n    username: admin\n    # 密码\n    password: 123456\n\n# ===============mybatis公共配置=================\nmybatis-plus:\n  configuration:\n    log-impl: org.apache.ibatis.logging.stdout.StdOutImpl\n    # 下划线转驼峰\n    map-underscore-to-camel-case: true\n# ===============自定义Starter功能配置=================\n# 基本属性配置\nkimzing:\n  sentinel:\n    enabled: true\n    exceptionHandler:\n      # 异常拦截开关\n      enabled: true\n      # 提示码\n      code: SECURITY\n      # 提示信息\n      message: 请求已被安全管控系统拦截，请联系管理员:kimzing@163.com\n  redis:\n    enabled: true\n    prefix: ${spring.application.name}\n    time-pattern: \"yyyy-MM-dd HH:mm:ss\"\n  log:\n    # 方法日志开关(默认false)\n    enabled: true\n    # 日志中的时间戳格式(可选)\n    time-pattern: yyyy-MM-dd HH:mm:ss:SSS\n  web:\n    escape:\n      # 是否开启URL和Cookie转义字符(默认true)\n      enabled: true\n    resolver:\n      # 是否开启Get请求方法解析(默认true)\n      json:\n        enabled: true\n    # 结果统一封装\n    result:\n      enabled: true\n      package: com.kimzing\n    advice:\n      # 是否启用异常拦截(默认false)\n      enabled: true\n    log:\n      # 是否启用请求日志打印(默认true)\n      enabled: true\n    cors:\n      # 是否开启跨域支持(默认true)\n      enabled: true\n      origins:\n        - \"*\"\n    restTemplate:\n      # 是否自动配置RestTemplate(默认true)\n      enabled: true\n    info:\n      # 是否启用/info接口(默认false)\n      enabled: true\n      # 接口路径\n      path: /\n      params:\n        application: ${spring.application.name}\n        port: ${server.port}\n        profile: ${spring.profiles.active}\n        version: ${spring.application.version}\n        description: ${spring.application.description}\n  # swagger配置\n  swagger:\n    # 当存在swagger依赖时，是否开启(默认true)\n    enabled: true\n    title: ${spring.application.name}-聚合服务\n    description: 聚合或代理内部接口对外提供服务\n    #termsOfServiceUrl: 项目服务地址\n    #authorName: 作者\n    #authorEmail: 作者邮箱\n    #authorUrl: 作者主页\n    #version: 版本\n    basePackage: com.kimzing\n  # 分布式调度系统配置\n  xxljob:\n    enabled: true\n    # 调度中心部署跟地址 [选填]：如调度中心集群部署存在多个地址则用逗号分隔。\n    # 执行器将会使用该地址进行\"执行器心跳注册\"和\"任务结果回调\"；为空则关闭自动注册；\n    adminAddresses: http://xxljob.kimzing.com:8092/xxl-job-admin\n    # 执行器通讯TOKEN [选填]：非空时启用；\n    accessToken: \n    executor:\n      # 执行器AppName [选填]：执行器心跳注册分组依据；为空则关闭自动注册\n      appname: ${spring.application.name}\n      # 执行器注册 [选填]：优先使用该配置作为注册地址，为空时使用内嵌服务 ”IP:PORT“ 作为注册地址。\n      address:\n      # 执行器IP [选填]：默认为空表示自动获取IP，多网卡时可手动设置指定IP，该IP不会绑定Host仅作为通讯实用；\n      # 地址信息用于 \"执行器注册\" 和 \"调度中心请求并触发任务\"；\n      ip:\n      # 执行器端口号 [选填]：小于等于0则自动获取；默认端口为9999，单机部署多个执行器时，注意要配置不同执行器端口；\n      port: 0\n      # 执行器运行日志文件存储磁盘路径 [选填] ：需要对该路径拥有读写权限；为空则使用默认路径；\n      logpath: ${user.home}/logs/xxljob/${spring.application.name}\n      # 执行器日志文件保存天数 [选填] ： 过期日志自动清理, 限制值大于等于3时生效; 否则, 如-1, 关闭自动清理功能；\n      logretentiondays: 30\n  # mybatis-plus配置\n  mybatis-plus:\n    page:\n      # 当存在mybatisPlus依赖时，是否开启分页(默认true)\n      enabled: true\n      # 分页join数量查询优化\n      optimizeJoin: true\n    performance:\n      # 当存在mybatisPlus依赖时，是否开启sql分析(默认true)\n      enabled: false\n      # 是否格式化输出SQL\n      formate: false\n      # 排查慢SQL的限制时间\n      maxTime: 1000\n  # 加载指定配置文件到Spring的Environment\n  property:\n    files: [\"classpath:exception.properties\"]', '3364b1b67d789368d391ef5dd7345334', '2020-08-25 21:33:58', '2020-08-25 13:33:59', NULL, '0:0:0:0:0:0:0:1', 'U', 'dev');
