INSERT INTO `his_config_info` VALUES (5, 40, 'service-user.yaml', 'DEFAULT_GROUP', '', 'server:\n  port: 8083\n    \nspring:\n  # 对应 RedisProperties 类\n  redis:\n    host: localhost\n    port: 6379\n    # Redis 服务器密码，默认为空。生产中，一定要设置 Redis 密码！\n    #password:\n    # Redis 数据库号，默认为 0\n    database: 0\n    # Redis 连接超时时间，单位：毫秒\n    timeout: 1000\n  datasource:\n    # 添加&allowMultiQueries=true使得一个接口可以执行多条语句\n    url: jdbc:mysql://mysql.kimzing.com:3306/springcloud-user?setUnicode=true&characterEncoding=utf8&allowMultiQueries=true&queryInterceptors=brave.mysql8.TracingQueryInterceptor&exceptionInterceptors=brave.mysql8.TracingExceptionInterceptor&zipkinServiceName=mysql-${spring.application.name}\n    username: root\n    password: 123456\n\ndubbo:\n  cloud:\n    # 服务消费方订阅服务提供方的应用名称的列表\n    # 若需订阅多应用，使用 \",\" 分割\n    subscribed-services: \"\"\n  scan:\n    # dubbo 服务扫描基础包路径\n    base-packages: com.kimzing.user.service\n    \n# 百度地图配置(模拟)\nbaidu:\n  map:\n    url: https://baidu.com/map', '2bb5c5ac10a6c289db9c719f87f582cf', '2020-08-26 02:28:17', '2020-08-25 18:28:18', NULL, '0:0:0:0:0:0:0:1', 'U', 'dev');
INSERT INTO `his_config_info` VALUES (6, 41, 'service-order.yaml', 'DEFAULT_GROUP', '', 'server:\n  port: 8081\n\nspring:\n  datasource:\n    # 添加&allowMultiQueries=true使得一个接口可以执行多条语句\n    url: jdbc:mysql://mysql.kimzing.com:3306/springcloud-order?setUnicode=true&characterEncoding=utf8&allowMultiQueries=true&queryInterceptors=brave.mysql8.TracingQueryInterceptor&exceptionInterceptors=brave.mysql8.TracingExceptionInterceptor&zipkinServiceName=mysql-${spring.application.name}\n    username: root\n    password: 123456\n\ndubbo:\n  cloud:\n    # 服务消费方订阅服务提供方的应用名称的列表\n    # 若需订阅多应用，使用 \",\" 分割\n    subscribed-services: \"\"\n  scan:\n    # dubbo 服务扫描基础包路径\n    base-packages: com.kimzing.order\n\n# 百度地图配置(模拟)\nbaidu:\n  map:\n    url: https://baidu.com/map', '35925c7da3324c6b549f00a3570c1e48', '2020-08-26 02:28:38', '2020-08-25 18:28:38', NULL, '0:0:0:0:0:0:0:1', 'U', 'dev');
INSERT INTO `his_config_info` VALUES (13, 42, 'service-product.yaml', 'DEFAULT_GROUP', '', 'server:\n  port: 8082\n    \nspring:\n  datasource:\n    # 添加&allowMultiQueries=true使得一个接口可以执行多条语句\n    url: jdbc:mysql://mysql.kimzing.com:3306/springcloud-product?setUnicode=true&characterEncoding=utf8&allowMultiQueries=true&queryInterceptors=brave.mysql8.TracingQueryInterceptor&exceptionInterceptors=brave.mysql8.TracingExceptionInterceptor&zipkinServiceName=mysql-${spring.application.name}\n    username: root\n    password: 123456\n\ndubbo:\n  cloud:\n    # 服务消费方订阅服务提供方的应用名称的列表\n    # 若需订阅多应用，使用 \",\" 分割\n    subscribed-services: \"\"\n  scan:\n    # dubbo 服务扫描基础包路径\n    base-packages: com.kimzing.product.service', 'a618e8a33979a29eb67a5a83b688b3a9', '2020-08-26 02:30:16', '2020-08-25 18:30:16', NULL, '0:0:0:0:0:0:0:1', 'U', 'dev');
